public class Solution {

    public static int sumOddLengthSubarrays(int[] arr) {
        int totalSum = 0;
        int n = arr.length;

        for (int i = 0; i < n; i++) {
            int end = i + 1;
            int start = n - i;
            int totalSubarrays = start * end;
            int oddSubarrays = (totalSubarrays + 1) / 2;
            totalSum += arr[i] * oddSubarrays;
