public class Solution {
    static long gcd(long a, long b) {
        while (b != 0) {
            long t = b;
            b = a % b;
            a = t;
        }
        return a;
    }

    static long lcm(long a, long b) {
        return a / gcd(a, b) * b;
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt();

        while (t-- > 0) {
            int n = sc.nextInt();
            int[] a = new int[n];
            for (int i = 0; i < n; i++) {
                a[i] = sc.nextInt();
            }

            long[] b = new long[n + 1];
            b[0] = a[0];
            for (int i = 1; i < n; i++) {
                b[i] = lcm(a[i - 1], a[i]);
            }
            b[n] = a[n - 1];

            boolean valid = true;
            for (int i = 0; i < n; i++) {
                if (gcd(b[i], b[i + 1]) != a[i]) {
                    valid = false;
                    break;
                }
            }

