            long maxGCD = 1;
            long currSum = 0;

            // Try splitting after each position and calculate GCD of left sum and remaining
            for (int i = 0; i < n - 1; i++) {
                currSum += a[i];
                long remSum = total - currSum;
                long gcd = gcd(currSum, remSum);
                maxGCD = Math.max(maxGCD, gcd);
            }

            System.out.println(maxGCD);
        }
    }

    // GCD helper
    static long gcd(long a, long b) {
        while (b != 0) {
            long tmp = a % b;
            a = b;
            b = tmp;
        }
        return a;
    }
}

