public class Solution {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt(); // Number of test cases

        while (t-- > 0) {
            int n = sc.nextInt();
            System.out.println(getMaxSum(n));
        }
    }

    static long getMaxSum(int n) {
        Map<Integer, Integer> primeFactors = new HashMap<>();

        // Prime factorization
        for (int i = 2; i * i <= n; i++) {
            while (n % i == 0) {
                primeFactors.put(i, primeFactors.getOrDefault(i, 0) + 1);
                n /= i;
            }
        }
        if (n > 1) {
            primeFactors.put(n, primeFactors.getOrDefault(n, 0) + 1);
        }

        long totalSum = 0;

        // Distribute the powers greedily to maximize ai * pi
        while (true) {
            int product = 1;
            List<Integer> toReduce = new ArrayList<>();

            for (Map.Entry<Integer, Integer> entry : primeFactors.entrySet()) {
                if (entry.getValue() > 0) {
                    product *= entry.getKey();
                    toReduce.add(entry.getKey());
                }
            }

            if (product == 1) break;

            totalSum += product;
            for (int p : toReduce) {
                primeFactors.put(p, primeFactors.get(p) - 1);
            }
        }

        return totalSum;
    }
}

