            long candidate = Long.parseLong(new String(chars));
            if (candidate > 0 && candidate <= n) {
                maxProduct = Math.max(maxProduct, productOfDigits(candidate));
            }
        }

        System.out.println(maxProduct);
    }

    // Compute product of digits
    static long productOfDigits(long num) {
        long prod = 1;
        while (num > 0) {
            prod *= (num % 10);
            num /= 10;
        }
        return prod;
    }
}

